--Lisätty koulutusalat 1-3. 
--Latauksen alussa tehdään nykytilapäivitys avainkoodeille, joten siirrytään tässäkin ottamaan myös vertailutiedot nykytilasta eli VipunenTK-kannan dimensioista. (Poistuneet 2002-tiedot haetaan koodistolatauksissa sopimusvuoden 2020 aineistosta.)
--Myös aineisto 3.10 on järjestäjätasolla, joten siirrytään käyttämään järjestäjän ainoaa korkeakoulua tulevaisuuden tuplien välttämiseksi (jos maailma muuttuu, tuntematon/puuttuva koulu helpompi huomata).

Update Ava --Select
Set 
-- tutkjarj, tutkkoulk, suorv, suorlk, tutkmaak, tilv, lahde,
  opp = case when ava.lahde in(41,42,46,51,52) then isnull(dop.koulutuksen_jarjestajan_ainoa_oppilaitos,'') else '' end,
  opmala = isnull(dko.koulutusala2002_koodi, ''),
  opmopa = isnull(dko.opintoala2002_koodi, ''),
  opmast = isnull(dko.koulutusaste2002_koodi, ''),
  opm95opa = isnull(dko.opintoala1995_koodi, ''),
  koulutussektori = 
	case 
		when coalesce(dko.Koulutusaste_taso2_koodi, dko.koulutusaste2002_koodi, '') = '' then ''
		when dko.koulutusaste2002_koodi = '31' or dko.Koulutusaste_taso2_koodi = '31' then 'Lukiokoulutus'
		when dko.koulutusaste2002_koodi = '32' or dko.Koulutusaste_taso2_koodi in ('32','33','41') then 'Ammatillinen koulutus'
		when dko.koulutusaste2002_koodi = '62' or dko.Koulutusaste_taso2_koodi = '62'  then 'Ammattikorkeakoulukoulutus'
		when dko.koulutusaste2002_koodi = '71' or dko.Koulutusaste_taso2_koodi = '71' then 'Ammattikorkeakoulukoulutus'
		when dko.koulutusaste2002_koodi = '63' or dko.Koulutusaste_taso2_koodi = '63' then 'Yiopistokoulutus'
		when dko.koulutusaste2002_koodi = '72' or dko.Koulutusaste_taso2_koodi = '72' then 'Yiopistokoulutus'
		when dko.koulutusaste2002_koodi = '73' or dko.Koulutusaste_taso2_koodi = '73' then 'Yiopistokoulutus'
		when dko.koulutusaste2002_koodi = '81' or dko.Koulutusaste_taso2_koodi = '81' then 'Yiopistokoulutus' 
		when dko.koulutusaste2002_koodi = '82' or dko.Koulutusaste_taso2_koodi = '82' then 'Yiopistokoulutus'
		else 'Virhetilanne'
	end,
  kalat1 = coalesce(dko.iscfibroad2013_koodi,''),
  kalat2 = coalesce(dko.iscfinarrow2013_koodi,''),
  kalat3 = coalesce(dko.iscfi2013_koodi,'')

